tude –2.6 in the southern sky. It dims two-tenths of a magnitude by the end of the month. Saturn, only 8° east of Jupiter, manages a fine magnitude 0.3, also dipping two-tenths of a magnitude by September 30. A waxing gibbous Moon lies in their vicinity September 24 and 25.

Let’s look at Jupiter first. It wanders westward until September 13, when it halts at its stationary point and returns to direct motion, shaving off a degree in the gap between itself and Saturn by the end of the month. The ringed planet reaches its stationary point two weeks later, on the 29th.

Jupiter’s disk spans 44" and presents a wealth of detail. Two dark equatorial belts are most obvious, and more delicate structures lie between them and at higher latitudes. The dusky features are best seen during moments of steady seeing, when patience will provide the reward of a stunning view. Occasionally, the Great Red Spot makes a commanding appearance, scooting across the disk in a matter of hours.

Your scope will also show the four famed Galilean moons, first spotted in 1610. Io, Europa, Ganymede, and Callisto orbit the planet every 1.8, 3.6, 7.2, and 16.7 days, respectively. The inner three moons are in a 4:2:1 orbital resonance, meaning every few days they return to approximately the same location relative to Jupiter. And all four moons undergo eclipses, transits, and occultations. Here are a few examples this month to watch for; note there are more than just those listed here during the month.

Io and Ganymede pass each other on September 15. From the Midwest and eastern U.S., Io and its shadow are already transiting Jupiter as darkness falls. Io leaves the disk at 9:51 P.M. EDT and wanders west, while Ganymede heads the other way. The pair is closest (10") around 10:30 P.M. EDT, then Ganymede continues toward the planet’s limb.
